import React from 'react'
import Typed from "react-typed"
import '../../Assets/Styles/Home.css';

function Home() {
    const textLines = [
        `Hey! Check out the nice library`,
        `It's animating <b>any text</b> you pass to it. <b>Just one line</b> of code!`,
        `In this example I've used React.js wrapper for Typed.js: <b>react-typed</b>`,
        `Such a cool effect, isn't it?`,
        `Follow <b>@room_js</b> to get more web development tricks!`
    ];
    return (
        <>
            <div className="homeContainer fullWithContainer">
                <div className="homeSubContainer leftSide">
                    <h1 id="homeHeading">Find
                        <Typed strings={textLines} typeSpeed={60} loop />
                    </h1>
                </div>
                <div className="homeSubContainer rightSide">

                </div>
                {/* <img src={debitCardPng} alt="debitCardImage" id='debitCardPng' className='backgroundImages'/> */}
                {/* <img src={bankPng} alt="bankImage" id='bankPng' className='backgroundImages'/> */}
            </div>
        </>
    )
}

export default Home
